import{_ as t,c as d,o as r,a3 as e}from"./chunks/framework.b23AWjfV.js";const b=JSON.parse('{"title":"HTTP 状态码","description":"","frontmatter":{},"headers":[],"relativePath":"MiscellaneousTalk/P1 概念系列/17.HTTP 状态码.md","filePath":"MiscellaneousTalk/P1 概念系列/17.HTTP 状态码.md"}'),a={name:"MiscellaneousTalk/P1 概念系列/17.HTTP 状态码.md"},o=e('<h1 id="http-状态码" tabindex="-1">HTTP 状态码 <a class="header-anchor" href="#http-状态码" aria-label="Permalink to &quot;HTTP 状态码&quot;">​</a></h1><h2 id="_1xx-消息" tabindex="-1">1xx 消息 <a class="header-anchor" href="#_1xx-消息" aria-label="Permalink to &quot;1xx 消息&quot;">​</a></h2><table tabindex="0"><thead><tr><th>状态码</th><th>描述</th></tr></thead><tbody><tr><td>100 Continue</td><td>请求者应当继续发送请求。服务器已收到部分请求，但尚未完成全部接收请求之前，不会做出任何响应。客户端可在接收到此状态码后发送主体数据（如 POST 请求的数据）。</td></tr><tr><td>101 Switching Protocols</td><td>服务器理解并接受客户端发起的协议切换请求，将在完成必要的步骤后开始使用新的协议与客户端通信。</td></tr><tr><td>102 Processing</td><td>WebDAV 中使用，表明服务器已经收到了请求，并正在处理，但没有可用的响应信息。主要用于长操作的初步确认，防止客户端超时。</td></tr><tr><td>103 Early Hints</td><td>服务器可以在正式响应到来之前，先返回一些链接提示（Link headers），以帮助客户端预先加载资源，提高性能。</td></tr></tbody></table><h2 id="_2xx-成功" tabindex="-1">2xx 成功 <a class="header-anchor" href="#_2xx-成功" aria-label="Permalink to &quot;2xx 成功&quot;">​</a></h2><table tabindex="0"><thead><tr><th>HTTP 2xx 状态码</th><th>描述</th></tr></thead><tbody><tr><td>200 OK</td><td>请求已成功，响应将返回请求所希望的资源或数据。</td></tr><tr><td>201 Created</td><td>请求已成功处理并创建了新资源；Location 头信息中包含新资源 URL。</td></tr><tr><td>202 Accepted</td><td>服务器已接受请求但未完成处理，可能不会执行，也可能在将来执行。</td></tr><tr><td>203 Non-Authoritative Information</td><td>代理服务器返回来自源服务器的成功响应，内容可能经过修改。</td></tr><tr><td>204 No Content</td><td>请求已成功处理，但响应体无内容；适用于无需实体返回的操作。</td></tr><tr><td>205 Reset Content</td><td>请求成功处理，客户端应重置文档视图（如清空表单）。</td></tr><tr><td>206 Partial Content</td><td>成功处理部分 GET 请求，用于实现断点续传和大文件分段下载。</td></tr><tr><td>207 Multi-Status</td><td>响应包含 XML 消息体，内含多个独立状态代码，用于批量操作结果反馈。</td></tr><tr><td>208 Already Reported</td><td>已在多状态响应前的部分列举所有相关成员，避免重复。</td></tr><tr><td>226 IM Used</td><td>服务器完成了对资源的一个或多个操作，并以实例管理协议的方式表示结果。</td></tr></tbody></table><h2 id="_3xx-重定向" tabindex="-1">3xx 重定向 <a class="header-anchor" href="#_3xx-重定向" aria-label="Permalink to &quot;3xx 重定向&quot;">​</a></h2><table tabindex="0"><thead><tr><th>HTTP 3xx 状态码</th><th>描述</th></tr></thead><tbody><tr><td>300 Multiple Choices</td><td>资源有多种选择，返回多个选项供用户或浏览器决定重定向地址。</td></tr><tr><td>301 Moved Permanently</td><td>资源已永久移动到新位置，客户端应使用响应中<code>Location</code>头信息指定的 URI。</td></tr><tr><td>302 Found (临时重定向)</td><td>请求资源临时存在于另一个 URI 上，后续请求通常仍指向原地址。</td></tr><tr><td>303 See Other</td><td>对 POST 等非 GET 请求的响应在另一个 URI 上，客户端应当通过 GET 方法获取。</td></tr><tr><td>304 Not Modified</td><td>资源未被修改，客户端可以继续使用缓存版本。</td></tr><tr><td>305 Use Proxy</td><td>客户端必须通过指定的代理服务器访问所请求的资源。</td></tr><tr><td>306 Switch Proxy (已弃用)</td><td>在旧规范中用于指示使用新的代理服务器，现已被弃用。</td></tr><tr><td>307 Temporary Redirect</td><td>请求应以提供的临时 URI 重新发送，不允许改变原始请求方法。</td></tr><tr><td>308 Permanent Redirect</td><td>类似于 301，但适用于不希望改变请求方法的情况（如 POST），请求和未来请求都应转向新的 URI。</td></tr></tbody></table><h2 id="_4xx-客户端错误" tabindex="-1">4xx 客户端错误 <a class="header-anchor" href="#_4xx-客户端错误" aria-label="Permalink to &quot;4xx 客户端错误&quot;">​</a></h2><table tabindex="0"><thead><tr><th>HTTP 4xx 状态码</th><th>描述</th></tr></thead><tbody><tr><td>400 Bad Request</td><td>由于客户端错误（如格式错误、大小过大或无效请求），服务器无法处理请求。</td></tr><tr><td>401 Unauthorized</td><td>用户未经过身份验证，需要提供有效的认证信息。</td></tr><tr><td>402 Payment Required</td><td>预留状态码，用于未来可能的支付需求。</td></tr><tr><td>403 Forbidden</td><td>服务器理解请求但拒绝执行，通常与权限问题相关。</td></tr><tr><td>404 Not Found</td><td>服务器上找不到请求的资源。</td></tr><tr><td>405 Method Not Allowed</td><td>请求的方法不被允许用于该资源。</td></tr><tr><td>406 Not Acceptable</td><td>服务器无法提供符合请求头中条件的响应。</td></tr><tr><td>407 Proxy Authentication Required</td><td>客户端必须通过代理进行身份验证。</td></tr><tr><td>408 Request Timeout</td><td>请求超时，客户端可无修改地重新提交请求。</td></tr><tr><td>409 Conflict</td><td>请求存在冲突，无法完成处理。</td></tr><tr><td>410 Gone</td><td>所请求的资源已永久删除。</td></tr><tr><td>411 Length Required</td><td>请求缺少 Content-Length 头信息。</td></tr><tr><td>412 Precondition Failed</td><td>服务器在验证请求头中的先决条件时未能满足其中的一个或多个条件。</td></tr><tr><td>413 Payload Too Large</td><td>请求实体数据过大，服务器无法处理。</td></tr><tr><td>414 URI Too Long</td><td>请求 URI 过长，服务器无法解析。</td></tr><tr><td>415 Unsupported Media Type</td><td>服务器不支持请求中提交的媒体类型。</td></tr><tr><td>416 Range Not Satisfiable</td><td>客户端请求的数据范围无法满足。</td></tr><tr><td>417 Expectation Failed</td><td>服务器无法满足请求头 Expect 字段指定的要求。</td></tr><tr><td>418 I&#39;m a teapot</td><td>愚人节玩笑状态码，非规范 HTTP 状态码。</td></tr><tr><td>421 Misdirected Request</td><td>请求针对的是无法产生响应的服务器。</td></tr><tr><td>422 Unprocessable Entity</td><td>请求格式正确但含有语义错误。</td></tr><tr><td>423 Locked</td><td>资源被锁定。</td></tr><tr><td>424 Failed Dependency</td><td>前置条件失败导致当前请求失败。</td></tr><tr><td>425 Too Early</td><td>服务器拒绝处理 Early Data 中的请求以防止重放攻击。</td></tr><tr><td>426 Upgrade Required</td><td>客户端需要切换到不同的协议版本。</td></tr><tr><td>428 Precondition Required</td><td>服务器要求请求满足特定条件。</td></tr><tr><td>429 Too Many Requests</td><td>客户端发送请求过多，超出限速限制。</td></tr><tr><td>431 Request Header Fields Too Large</td><td>请求头字段过大，服务器拒绝处理。</td></tr><tr><td>440 Login Time-out</td><td>客户端会话超时失效，需要重新登录。</td></tr><tr><td>451 Unavailable For Legal Reasons</td><td>访问因法律原因而被拒绝。</td></tr></tbody></table><h2 id="_5xx-服务器错误" tabindex="-1">5xx 服务器错误 <a class="header-anchor" href="#_5xx-服务器错误" aria-label="Permalink to &quot;5xx 服务器错误&quot;">​</a></h2><table tabindex="0"><thead><tr><th>HTTP 5xx 状态码</th><th>描述</th></tr></thead><tbody><tr><td>500 Internal Server Error</td><td>服务器遇到意外情况，无法完成请求处理。</td></tr><tr><td>501 Not Implemented</td><td>服务器不支持请求所需的功能或方法。</td></tr><tr><td>502 Bad Gateway</td><td>作为网关或代理的服务器从上游服务器接收到无效响应。</td></tr><tr><td>503 Service Unavailable</td><td>服务器暂时过载或维护中，无法处理请求，通常为临时状态。</td></tr><tr><td>504 Gateway Timeout</td><td>作为网关或代理的服务器在规定时间内未收到上游服务器的响应。</td></tr><tr><td>505 HTTP Version Not Supported</td><td>服务器不支持客户端使用的 HTTP 版本。</td></tr><tr><td>506 Variant Also Negotiates</td><td>服务器配置错误，导致透明内容协商变元资源不能被正确使用。</td></tr><tr><td>507 Insufficient Storage</td><td>服务器存储空间不足，无法完成请求，通常为临时状态。</td></tr><tr><td>508 Loop Detected</td><td>服务器在处理请求时检测到死循环。</td></tr><tr><td>510 Not Extended</td><td>获取资源所需的策略未满足。</td></tr><tr><td>511 Network Authentication Required</td><td>客户端需要进行身份验证才能访问网络资源。</td></tr></tbody></table><h2 id="参考文献" tabindex="-1">参考文献 <a class="header-anchor" href="#参考文献" aria-label="Permalink to &quot;参考文献&quot;">​</a></h2><p><a href="https://zh.wikipedia.org/wiki/HTTP%E7%8A%B6%E6%80%81%E7%A0%81" target="_blank" rel="noreferrer">https://zh.wikipedia.org/wiki/HTTP状态码</a></p>',13),i=[o];function n(h,l,s,x,c,T){return r(),d("div",null,i)}const P=t(a,[["render",n]]);export{b as __pageData,P as default};
